import React from 'react';

import Bestoffersitem from "./Bestoffersitem"
import bestoffersData from "./bestoffersData"



const Bestoffers = () =>{

    return(
        <div class="container-main-bestoffers">
			<div class="title-main-bestoffers">Лучшие предложения</div>
			<div class="best-offers-main">
                {
                    bestoffersData.map(({
                        id,
                        name,
                        price,
                        adress,
                        metro,
                        time,
                        image,
                    }) =>(
                        <div className="best-offers" key={id}>
                                <Bestoffersitem
                                        name={name}
                                        price={price}
                                        adress={adress}
                                        metro={metro}
                                        time={time}
                                        image={image} 
                                    />
                        </div>
                    ))
                    }
            </div> 
            </div>           
    )
}





export default Bestoffers;
